script: |
  super -f text -I q11716.spq | sort > q11716.out

inputs:
  - name: q11716.spq
    data: |
      SELECT + col0 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE col2 NOT IN ( - col0, col2 / - - col0 * + ( col2 ) * + col2 / + 50, + + 83, col2, + + col1 * - col1 / - ( + + 62 ) );
  - name: tab0

outputs:
  - name: q11716.out
    data: |
